script: |
  super -f text -I q4667.spq | sort > q4667.out

inputs:
  - name: q4667.spq
    data: |
      SELECT ALL - 52 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col2 * + + 84 + 22 BETWEEN ( col1 ) AND - - 92;
  - name: tab0

outputs:
  - name: q4667.out
    data: |
      -52
      -52
      -52
